import React from "react";
import { SmileCoordinates } from "./types";

interface Props {
  image?: string;
  coords?: SmileCoordinates[];
}

const SmileViewer: React.FC<Props> = ({ image, coords }) => (
  <div style={{ display: "flex", width: "100%" }}>
    <div style={{ flex: 1 }}>
      {image ? (
        <img src={`http://localhost:5001${image}`} alt="Detected Smile" style={{ width: "100%" }} />

      ) : (
        <div style={{ padding: "1em", textAlign: "center" }}>No Image Available</div>
      )}
    </div>
    <div style={{ flex: 1, padding: "1em" }}>
      <h3>Smile Coordinates</h3>
      <pre>{coords ? JSON.stringify(coords, null, 2) : "No smile detected"}</pre>
    </div>
  </div>
);

export default SmileViewer;
